import styles from './Navbar.module.css';

const Navbar = () => {

    const navlinks = ['Contact','Projects','Experience','About','Home']
    const navlink = navlinks.map((link) => <a>{link}</a>)

    return (
        <div className={styles.navbar}>
            <p>MyFolio</p>
            <>
            {navlink}
            </>
            <i class="fa-solid fa-bars"></i>
        </div>
    );
}

export default Navbar;
